import React from 'react'


const cards = [
    {img: "0.png", text: "OASIS - небольшая частная компания, созданная более 5 лет назад, для улучшения качетсва жизни на загородном участке..."},
    {img: "3.png", text: "Наша конманда состоит из опытных специалистов! Вот они справа надево"}
]

export default function Introduction() {
    return (
        <div className="Pep">
        <PrintCards cards={cards}></PrintCards>
            {/* вщламлфвтщау */}
        </div>
    )
}
